import React from 'react';
import './navbar.css';

const Navbar = () => {
    return(
        <nav>

            <div className='box-img-perfil'>
                <div></div>
                <p>Jossue Fuentes</p>
            </div>

            <div>
                <ul>
                    <li>Home</li>
                    <li>Articles</li>
                    <li>Portfolio</li>
                    <li>Stack</li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
